\u5b66\u30011949\u5e74\u3001\u5168\u9023\u90a6\u5171\u7523\u515a\uff08\u30dc\u30ea\u30b7\u30a7\u30f4\u30a3\u30ad\u515a\uff09\u4e2d\u592e\u59d4\u54e1\u4f1a\u9644\u5c5e\u9ad8\u7b49\u515a\u5b66\u6821\u5352\u696d\u30021925\u5e74 - \u30bf\u30b7\u30e5\u30b1\u30f3\u30c8\u5e02\u306e\u30da\u30f3\u30ad\u5c4b\u3001\u5de6\u5b98\u3001\u5efa\u8a2d\u52b4\u50cd\u80051929\u5e7410\u6708 - \u30a6\u30ba\u30d9\u30ad\u30b9\u30bf\u30f3\u5171\u7523\u515a\u30bf\u30b7\u30b1\u30f3\u30c8\u5e02\u30aa\u30af\u30c1\u30e3\u30d6\u30ea\u30b9\u30ad\u30fc\u5730\u533a\u59d4\u54e1\u4f1a\u306e\u5ba3\u4f1d\u5b981930\u5e7410\u6708 - \u30b3\u30e0\u30bd\u30e2\u30fc\u30eb\u30fb\u30ce\u30f4\u30a9\u30d6\u30cf\u30eb\u30b9\u30ad\u30fc\u5730\u533a\u59d4\u54e1\u4f1a\u66f8\u8a181931\u5e747\u6708 - \u30b3\u30e0\u30bd\u30e2\u30fc\u30eb\u4e2d\u592e\u30a2\u30b8\u30a2\u5730\u65b9\u59d4\u54e1\u4f1a\u5927\u8846\u7d4c\u6e08\u8ab2\u526f\u4e3b\u4efb1933\u5e746\u6708 - \u30b3\u30e0\u30bd\u30e2\u30fc\u30eb\u30fb\u30ab\u30e9\u30ab\u30eb\u30d1\u30af\u5dde\u59d4\u54e1\u4f1a\u7b2c\u4e00\u66f8\u8a181936\u5e749\u6708 - \u30bf\u30b7\u30e5\u30b1\u30f3\u30c8\u30fb\u30de\u30eb\u30af\u30b9\u30fb\u30ec\u30fc\u30cb\u30f3\u4e3b\u7fa9\u5927\u5b66\u3067\u6559\u80b2\u30021937\u5e7411\u6708\u307e\u3067\u540c\u5927\u5b66\u306e\u515a\u59d4\u54e1\u4f1a\u66f8\u8a181937\u5e7411\u6708 - \u30a6\u30ba\u30d9\u30ad\u30b9\u30bf\u30f3\u5171\u7523\u515a\u30d5\u30a7\u30eb\u30ac\u30ca\u5dde\u30bf\u30b7\u30e5\u30e9\u30af\u30b9\u30ad\u30fc\u5730\u533a\u59d4\u54e1\u4f1a\u7b2c\u4e00\u66f8\u8a18\u306b\u9078\u51fa1938\u5e744\u6708 - \u30a6\u30ba\u30d9\u30ad\u30b9\u30bf\u30f3\u5171\u7523\u515a\u30d5\u30a7\u30eb\u30ac\u30ca\u5dde\u30de\u30eb\u30b2\u30e9\u30f3\u30b9\u30ad\u30fc\u5730\u533a\u59d4\u54e1\u4f1a\u7b2c\u4e00\u66f8\u8a181938\u5e748\u6708 - \u30a6\u30ba\u30d9\u30ad\u30b9\u30bf\u30f3\u5171\u7523\u515a\u30d5\u30a7\u30eb\u30ac\u30ca\u5dde\u59d4\u54e1\u4f1a\u8fb2\u696d\u8ab2\u4e3b\u4efb\u300111\u6708\u304b\u3089\u66f8\u8a181940\u5e7410\u6708\uff5e1941\u5e744\u6708 